import ReactDocRenderer from 'react-doc-renderer';

function App() {

  const docs = [
    // { path: 'a/b/c.md', component: () => <div>Document 1</div> },
    { path: '/Display.pdf', component: () => <div>Display.pdf</div> }

  ];

  return (
    <div className="App">
    {/* <Display /> */}
    {/* <DocViewer documents={docs}/> */}
    <ReactDocRenderer docs={docs} />
    </div>
  );
}

export default App;
